import { SafeAreaView } from "react-native-web";
import { dataview } from "../styles/Dataview";
import { View,Text } from "react-native";

export const ProjectDetailView = ({ item }) => {
    console.log(item);
    aadhar: "1"
buildingApproval: "Done"
buildingCompletion: "1"
clientName: "ram"
email: "1"
model3D: "DOshi technologies"
pan: "1"
pin: "1"
plinth: "1"
projectHead: "Ketan"
projectType: "mga"
rccDesignerName: "Ganpati"
title: "Ram Mandir"
    return (
        <SafeAreaView style={dataview.DetailView} >
            <View >
                <View >
                    <Text style={dataview.textStyle}>
                        {item.name}
                    </Text>
                    <Text style={dataview.textStyle} >
                        {item.email}
                    </Text>
                    <Text style={dataview.textStyle}>
                        {item.aadhar}
                    </Text>
                </View>
            </View>
        </SafeAreaView>
    )
}
